import React from 'react';
import Post from "../Post/Post";

const PostList = ({posts}) => {
    return (
        <div>
            <h3>Список постов</h3>
            {posts.map(post =>
                <Post key={post.id} post={post} />
            )}
        </div>
    );
};

export default PostList;
